import React from 'react';
import styled from 'styled-components';
import {Box, Button, Grid} from '@material-ui/core'
import s from '../../styles/styles.module.css'
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Spacer from 'react-spacer'


const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,

    },
    paper: {
      height: 200,
      width: 200,
      padding: theme.spacing(2),
      textAlign: 'center'

    },
    control: {
      padding: theme.spacing(2),
    },
  }));


  export default function Hero() {
    const [spacing, setSpacing] = React.useState(2);
    const classes = useStyles();
    const Text = styled.p`
    color: white;
    text-align: left;
    font-size: 1em;
    margin: 1em;
    padding: 0.25em 1em;
    `
    const BoxHeading = styled.h3`
    text-transform: uppercase;
    `
   return (

            <Box p={2} >


            <Grid container justify="center" spacing={spacing}>
            <Grid item xs={12}>
            <Spacer height="40px"/>
              <h2 className={s.header} style={{textAlign: 'center'}}>
              Choose your AI brain from a library
              </h2>
              <p className={s.subheader}>Start using it now with no technical skills or training required, or integrate the model into your app using our API and JSON feeds</p>
              <Spacer height="40px"/>
              </Grid>
            <Grid item>
              <Paper className={classes.paper} >
                  <BoxHeading>Choose data</BoxHeading>
             </Paper>
            </Grid>
            <Grid item>
              <Paper className={classes.paper} >
              <BoxHeading>Choose model</BoxHeading>
             </Paper>
            </Grid>
            <Grid item>
              <Paper className={classes.paper} >
              <BoxHeading>Get results</BoxHeading>
             </Paper>
            </Grid>
            </Grid>

                <Spacer height="40px"/>
              <Button size="large" variant="contained" color="secondary" href="/auth">
                <strong>Get Started</strong>
              </Button>
            </Box>


     )
    }
